import styled from "styled-components";

export const Layout = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

export const Movie = styled.div`
  margin-bottom: 10px;
`;

// TODO: find out why styled(MovieItem) does not work
export const SpacedMovieItem = ({ children }: { children: any }) => {
  return <Movie>{children}</Movie>;
};
